import React from 'react';
import logo from '../styles/Logo.module.css';

const Logo = ({ dark }) => {
  return (
    <a href="#" className={logo.main}>
      <a>
        <svg className={logo.circle} xmlns="http://www.w3.org/2000/svg" width="50" height="50" viewBox="0 0 100 100">
          <defs>
            <linearGradient id="gradient" x1="0%" y1="0%" x2="0%" y2="100%">
              <stop offset="0%" stop-color="#ec5200" />
              <stop offset="100%" stop-color="transparent" />
            </linearGradient>
          </defs>
          <circle cx="50" cy="50" r="40" stroke="url(#gradient)" stroke-width="13" fill="none" transform='rotate(90 50 50)' />
        </svg>
      </a>
      <div className={logo['text-container']}>
        <span className={logo.text}>Circle</span>
      </div>
    </a>
  )
}

export default Logo;
